import './App.js'
import createSudoku  from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
let count=0;
let temp=JSON.parse(JSON.stringify(sudoku));
for(let i=0;i<temp.length;i++)
{
  for(let j=0;j<temp[i].length;j++)
  temp[i][j]=count++;
}
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  constructor(){
    super()
  }
  func=()=>{
    root.render(<Sudoku arr={sudoku} />)
  }
  render(){
    return (<button className='startButton'onClick={this.func}>
      CLICK TO START
    </button>)
  }
}
count=0;
let render=(arr)=>{
  let fin=[]
  for(let i=0;i<arr.length;i++)
  {
    let k=[]
    for(let j=0;j<arr[i].length;j++)
    {
      if(sudoku[i][j]==-1)
      k.push(<div className='Sudoku'><Input  r={i}c={j}/><br/></div>)
      else
      k.push(<div className='Sudoku'><Element val={temp[i][j]}/></div>)
    }
    fin.push(k)
  }
  return fin;
}
class Sudoku extends React.Component{
     constructor(props)
     {
      super(props);
     }

     render(){
         return render(this.props.arr);
     }
}
