      <div className='Element'>
        {this.props.val}
      </div>
    )
  }
}
class Input extends React.Component{
  constructor(props){
    super(props);
    this.state={"row":this.props.id}
  }
  func=(e)=>{
    let v=e.target.value
    if(v.length>1){
      alert("invalid number")
    }
    temp[this.props.r][this.props.c]=v;
  }
  render(){
    return (
      <input type="text"  className="Element1" onKeyUp={this.func}/>
    )
  }
}
